import React from 'react';
import Aux from '../Aux/Aux';

import Toolsbar from '../../Navigation/Toolsbar/Toolsbar';
import SideDrawer from '../../Navigation/SideDrawer/SideDrawer';

const layout = props => (
    <Aux>
        <Toolsbar />
        <SideDrawer />
        <main>
            {props.children}
        </main>
    </Aux>
)

export default layout
